import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid';
import Box from '@material-ui/core/Box';
import Button from '@material-ui/core/Button';
import Divider from '@material-ui/core/Divider';
import { Link } from 'react-router-dom'
import Axios from 'axios'


const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
      width: '100%',
    },
  },
}));

export default function Auth() {
  const classes = useStyles();

  return (
    <Container maxWidth="xl" style={{ height: '100vh'}}>
      <Box p={20}>
        <Grid
          container
          direction="row"
          justify="center"
          spacing={5}
        >
          <Grid item xs={3}>
            <form className={classes.root} noValidate autoComplete="off">
              <TextField id="outlined-basic" label="Логин" variant="outlined" style={{ borderColor: 'white' }} required />
              <TextField id="outlined-basic" label="Пароль" variant="outlined" required />
              <Button variant="outlined" href='/folders'>Войти</Button>
              <Button variant="outlined">Забыли пароль</Button>
            </form>
          </Grid>
            <Divider
              orientation='vertical'
              flexItem='true'
            />
          <Grid item xs={3}>
            <form className={classes.root} noValidate autoComplete="off">
              <TextField id="outlined-basic" label="Логин" variant="outlined" />
              <TextField id="outlined-basic" label="Эмейл" variant="outlined" />
              <TextField id="outlined-basic" label="Пароль" variant="outlined" />
              <Button variant="outlined">Зарегистрироваться</Button>
            </form>
          </Grid>
        </Grid>
      </Box>
    </Container>
  );
}
